import {button, Breadcrumb, Card, Form, Container, Row, Col,Table} from "react-bootstrap"
import React, { useState,useEffect } from "react"

function Fetchmusic() {
    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [items, setItems] = useState([]);
 
    useEffect(() => {
      fetch("http://localhost:8080/SolidCode-BackEnd/api/solidMusic/search?q=STFU ")
        .then(res => res.json())
        .then(
          (result) => {
            setIsLoaded(true);
            setItems(result);
            console.log(result.response);
            console.log(result.response);
            console.log(result.response.hits);
            console.log("items: "+items)
            console.log(items)
            console.log(items.response)
            console.log(items.response.hits.forEach(element => console.log(element.result.full_title)))
            console.log("lol "+items.response.hits.map(item =>
              item.result.full_title))

          },
          (error) => {
            setIsLoaded(true);
            setError(error);
          }
        )
    }, [])
  
    if (error) {
      return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
      return <div>Loading...</div>;
    } else {

     
      return (
        <container className="themed-container" fluid="md">
        <Table striped bordered hover variant="dark" responsive>
        <thead>
          <tr>
             <th scope="col">Title name</th>
             <th scope="col">Artist</th>
        </tr>
        </thead>
        <tbody>
         {items.response.hits.map(item =>
            <>
          <tr>  
          <td>
          {item.result.title}</td>
            <td> {item.result.primary_artist.name} </td>
    
            </tr>
           </>
           )}
          </tbody>
          </Table>
          </container>
      );
    }
  }

  export {Fetchmusic}
